# 런타임 재시작

# Generate a boxplot
data.boxplot(fontsize=6, vert=False)
plt.show()

# Generate numerical summaries
print(data.describe())

# Print the name of the time series with the highest mean
highest_mean_series = data.describe().loc['mean'].idxmax()
print(f'Time series with the highest mean: {highest_mean_series}')

# Print the name of the time series with the highest variability
highest_variability_series = data.describe().loc['std'].idxmax()
print(f'Time series with the highest variability: {highest_variability_series}')

# Create a faceted graph with 1 row and 2 columns
ax = data.plot(subplots=True,
               layout=(2, 1),
               sharex=False,
               sharey=False,
               linewidth=0.7,
               fontsize=3,
               legend=False)

ax[0, 0].set_title("일산화탄소 농도")
ax[1, 0].set_title("오존 농도")

plt.show()

# Plot all time series in the data DataFrame
ax = data.plot(colormap='Spectral', fontsize=6, linewidth=0.8)

# Set labels and legend
ax.set_xlabel('Date', fontsize=10)
ax.set_ylabel('Concentration', fontsize=10)
ax.set_title('Concentration levels over time', fontsize=10)
ax.legend(loc='center left', bbox_to_anchor=(1.0, 0.5))

plt.show()

# Extract the month from the index of data
index_month = data.index.month

# Compute the mean concentration for each month
data_by_month = data.groupby(index_month).mean()

# Plot the mean concentration for each month
ax = data_by_month.plot(fontsize=6, linewidth=1)

# Set axis labels and legend
ax.set_xlabel('Month', fontsize=10)
ax.set_ylabel('Mean Concentration', fontsize=10)
ax.legend(bbox_to_anchor=(0.8, 0.6), fontsize=10)
plt.show()

# Initialize dictionary
# Used to store decomposition results
data_decomp = {}

# Get the names of each time series in the DataFrame
data_names = data.columns

# Run time series decomposition on each time series of the DataFrame
for ts in data_names:
    # 덧셈 모델 사용, 하루에 24개의 관측치이기 때문에 일일 계절성 period = 24
    ts_decomposition = sm.tsa.seasonal_decompose(data[ts], model='additive', period=24)
    data_decomp[ts] = ts_decomposition

# Extract the seasonal values for the decomposition of each time series
# 각 열에 대해 시계열 분해 결과에서 계절성 요소 추출
# 추출된 계절성 요소는 열 이름을 키로 하여 저장, 아래 결과창
data_seasonal = {ts: data_decomp[ts].seasonal for ts in data_names}

# Create a DataFrame from the data_seasonal dictionary
seasonality_df = pd.DataFrame(data_seasonal)

# Create a faceted plot of the seasonality_df DataFrame
seasonality_df.plot(subplots=True,
                   layout=(2, 1),
                   sharey=False,
                   fontsize=2,
                   linewidth=0.3,
                   legend=False)

